import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const AjouterStg = () => {
    const [nouveauStg,setnouveauStg]=useState({image:"",nom:"",prenom:"",email:""})
    return (
        <>
            <form>
                <fieldset>
                    <label> Image : </label>
                    <input  type='text' id="image" onChange={()=>setnouveauStg}/><br/>
                    <label>Nom : </label>
                    <input  type='text' id="nom"/><br/>
                    <label>Prenom : </label>
                    <input  type='text' id="prenom"/><br/>
                    <label> Email</label>
                    <input  type='text' id="email"/><br/>
                    <Link to="/"><button type='button'>Ajouter</button></Link>
                </fieldset>
            </form>    
        </>
    );
}

export default AjouterStg;
